function formatMiles(miles) {  
  miles = miles.toFixed(2);
  return miles;
}



function cleanData(data) {
  for (var i = 0; i < newData.length; i++) {
    newData[i].miles = formatMiles(data[i].miles);
  }
};
let newData = data;
cleanData(data);


